module Quest_18_input where
import Parser
import Control.Applicative (some, (<|>))
import Data.List (nub)
import Data.Char
import Data.Either

symbol = oneOf (['A'..'Z'] ++ ['#', '.'])
sep0 = char '\n'

type Term = String

term :: Parser Char Integer Term
term = some symbol

final :: Parser Char Integer [Term]
final = sepBy term sep0 <* eof

run part = parse (final >>= (return . part))

